    --border-s: .5px solid;

/* variable */

:root {
    --height-l: 44px;
    --height-m: 36px;
    --height-s: 28px;
}

.type-filled,
.type-outlined,
.text,
.night {
    display: flex;
    justify-content: center;
    align-items: center;
    width: 100%;
    border-radius: 100px;
}


/* type */

.type-filled {
    background: var(--color-brand);
    border: none;
    color: var(--color-highlighted);
}

.type-outlined {
    background: none;
    border: 1px solid var(--color-brand);
    color: var(--color-brand);
}

.type-text {
    background: none;
    border: none;
}


/* size */

.size-l {
    height: var(--height-l);
    font-size: var(--text-l);
    padding: 0px 22px;
    font-weight: 600;
}

.size-m {
    height: var(--height-m);
    font-size: var(--text-m);
    padding: 0px 18px;
}

.size-s {
    height: var(--height-s);
    font-size: var(--text-s);
    padding: 0px 14px;
}


/* status */

.status-normal {
    filter: brightness(100%);
}

.status-disabled {
    filter: contrast(90%);
}

.status-pressed {
    filter: brightness(90%);
}


/* inline */

.inline-true {
    display: inline-flex;
    width: auto;
}

.inline-false {
    display: flex;
}


/* theme，填充主题 */

.theme-color-brand {
    background: var(--color-brand);
    color: var(--color-highlighted);
    border: none;
}

.theme-color-action {
    background: var(--color-action);
    color: var(--color-highlighted);
    border: none;
}

.theme-color-warning {
    background: var(--color-warning);
    color: var(--color-highlighted);
    border: none;
}


/* theme, 描边主题 */

.theme-color-brand-outlined {
    background: none;
    color: var(--color-brand);
    border: 1px solid var(--color-brand);
}

.theme-color-action-outlined {
    background: none;
    border: 1px solid var(--color-action);
    color: var(--color-action)
}

.theme-color-warning-outlined {
    background: none;
    color: var(--color-warning);
    border: 1px solid var(--color-warning);
}</style><link rel="stylesheet" href="./css(1)" media="all"><link rel="stylesheet" href="./css(2)" media="all"><link rel="stylesheet" href="./css(3)" media="all"><link rel="stylesheet" href="./css(4)" media="all"><style type="text/css">
